		function getTotalTime(timeInSecs) {
			// חישוב דקות
			var min = Math.floor(timeInSecs / 60);
			// חישוב בשניות
			var sec = timeInSecs - 60 * min;
		
			// משתנים שיתעדכנו בהתאם לתנאים ויחזרו כמחרוזות של זמן
			var minAfterCheck;
			var secAfterCheck;
		
			if (min < 10) {
				minAfterCheck = "0" + min + ":";
				if (min == 0) {
					minAfterCheck = "00:";
				}
			} else {
				minAfterCheck = min + ":";
			}
		
			if (sec < 10) {
				secAfterCheck = "0" + sec;
				if (sec == 0) {
					secAfterCheck = "00";
				}
			} else {
				secAfterCheck = sec;
			}
		
			return minAfterCheck + secAfterCheck;
		}
		
